import React from 'react';
import TopAgents from '../components/TopAgents';

const Agents = () => {
  return (
    <div className="page-container">
      <div className="container">
        <h1 className="section-title">Real Estate Agents</h1>
        <TopAgents />
      </div>
    </div>
  );
};

export default Agents;
